import React from "react";
import Jumbotron from "../components/Jumbotron";
import { Col, Row, Container } from "../components/Grid";
import { List, ListItem } from "../components/List";

function Home() {
    return (
        <Container fluid>
            <Row>
            <Col size="md-6">
                <Jumbotron>
                    <h1>You Can Do This</h1>
                </Jumbotron>
            </Col>
            </Row>
        </Container>
    )
}

export default Home;
